package Com.Pattern;
//WAP to print Star in a matrix
public class StarClass2 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		String s1 = "123";
		System.out.println(s1);
		
		
		for (int i =1; i<=5; i++) {
			
			for (int j=1; j<=5; j++) {
				System.out.print(" * ");
			}
			System.out.println(); 
			
		}
	}

}
